CREATE FUNCTION [dbo].[fnGetCurrentProcessPartCount] 
(
	@orderID int
)
RETURNS int
AS
BEGIN
	
	-- Find order process that is current
	RETURN (SELECT TOP(1) PartCount FROM [OrderProcesses] WHERE StartDate IS NOT NULL AND EndDate IS NULL AND OrderID = @orderID ORDER BY StepOrder)

END

GO

